import {Modal, Button} from "reactstrap";

const BookingModal = (props) => {
    return (
        <Modal
            {...props}
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
            centered
        >

        </Modal>
    );
};

export default BookingModal;
